_csuisup-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces;
  intstuffName: symbol = the symbol int-internals-workspaces;

  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert _csuisup-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert _csuisup-internals at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

csuisup-create-dxi-export-object (Client: class ui-client-item ) = (class dxi-file-export-object{, truth-value})
DXI: class dxi-file-export-object;
NewDXI: truth-value;
begin
    DXI, NewDXI = call _csuisup-create-dxi-export-object (Client);
    return DXI{, NewDXI  In the classic, if the DXI object is newly created, and subsequent dialogs are cancelled, the DXI object is deleted.  This behavior is only for the export, not for the import, and is not at the moment supported in the Java}
end

slightly-different-rest-of-procedure (NewDXI: truth-value, Win: class g2-window)
DXI: class dxiui-file-input-object;
Dlg, Button: item-or-value;
Settings: class g2ui-file-dialog-settings;
Filename, Directory: text;
Type: symbol;
DialogName: text;
begin
    create a g2ui-file-dialog-settings Settings by cloning _opcsui-import-domain-map-dialog-settings;
    conclude that the default-filter of Settings = the dxiui-default-filter of DXI;
    Type = call g2-type-of-file-system ();
    DialogName = (if Type = the symbol win32 then "dxi-import-map-pc-dialog" else "dxi-import-map-dialog");
    if Button exists and Button is an item and not (the uil-cancel-button of Button) and Dlg exists and Dlg is an item then begin
        Filename = call uil-get-edit-box-value (Dlg, "filename-edit-box");
        Directory = call uil-get-edit-box-value (Dlg, "directory-edit-box");
        call uil-release-dialog (Dlg, Win, false);
        conclude that the dxiui-directory of DXI = Directory;
        conclude that the dxi-input-file-name of DXI = "[Directory][Filename]";
        start _opcsui-post-dxi-status (this procedure-invocation, DXI, Win);
        call csuisup-process-dxi-object (DXI);
        start uil-post-generic-dialog ("[the dxi-status of DXI]", the symbol message, the symbol medium, Win, the symbol uil-information-icon);
        make DXI transient;
        conclude that DXI is not the-uil-temporary-storage-object-of Dlg;
    end
    else if NewDXI then begin
        make DXI transient;
        delete DXI;
    end;
    delete Settings;
end

_csuisup-create-dxi-export-object (Client: class ui-client-item) = (class dxiui-file-output-object, truth-value)
CreationFailedError: class error;
DXI: class dxi-file-export-object;
TopModule, TranslationWkspName, DestinationWkspName, DefaultClassName, AddResult: symbol;
begin
    if there exists a dxi-file-export-object DXI that is _dxiui-object-for-window Client then return DXI, false 
    else begin
        create a dxiui-file-output-object DXI;
        conclude that DXI is now _dxiui-object-for-window Client;
        TopModule = call _devui-get-top-level-module ();
        TranslationWkspName = symbol ("[TopModule]-translation-objects");
        if there exists an item I named by TranslationWkspName and (I is a kb-workspace or the subworkspace of I exists) then conclude that the dxi-output-translation-workspace of DXI = TranslationWkspName;
        AddResult = call _devui-add-item-to-storage-bin (DXI, TopModule, "", Client);
        make DXI transient; 
        if AddResult /= the symbol OK then begin
            delete DXI;
            signal CreationFailedError;
        end;
        return DXI, true;
    end 
end

csuisup-process-dxi-object (DXI: class dxi-api-object)
T, FileExt: text;
C: integer = 0;
EN: symbol;
ET: text;
IsImport: truth-value = DXI is a dxi-file-import-object;
Keyword: text = (if IsImport then "Import" else "Export");
{FullFileName: text = (if IsImport then the dxi-input-file-name of DXI else the dxi-output-file-name of DXI);  {Why don't these share the same attribute name?}{
Pos: integer = position-of-text (".", FullFileName);
Len: integer = length-of-text (FullFileName);}
begin
    {if Pos /= 0 then FileExt = "*.[get-from-text (FullFileName, Pos + 1, Len)]"
    else FileExt = "*.txt";
    conclude that the dxiui-default-filter of DXI = FileExt;  Java doesn't use the filter}
    if IsImport then call dxi-start-import (DXI) else call dxi-start-export (DXI);
    for T = each text in the _dxi-notes-list of DXI do
        C = C + 1;
        call devu-error-handler (DXI, DXI, "DXI [Keyword] [C]", the array-length of opfom-priority-alarm-colors, (if IsImport then the symbol DXI-Import else the symbol DXI-Export), T, 9999);
    end;
    make DXI transient;
end on error (en, et)
    inform the operator that "DXI [Keyword] failed [the dxi-status of DXI] : [crlf] [et]";
end

csuisup-create-dxi-import-object (Client: class ui-client-item ) = (class dxi-file-import-object )
DXI: class dxi-file-import-object;
begin
    DXI = call _csuisup-create-dxi-object (Client);
    return DXI
end

rest-of-procedure (PromptForOptions: truth-value, Win: class g2-window)
DXI: class dxiui-file-input-object;
Dlg, Button: item-or-value;
Settings: class g2ui-file-dialog-settings;
Filename, Directory: text;
Type: symbol;
DialogName: text;
begin
    if PromptForOptions then begin
        Dlg, Button = call uil-start-dialog ("DXI-Input-options-dlg", DXI, Win);
        if Button exists and Button is an item and (the uil-cancel-button of Button) then begin
            make DXI transient;
            delete DXI;
            call uil-release-dialog (Dlg, Win, false);
            return;
        end;
        if Dlg exists and dlg is an item then call uil-release-dialog (Dlg, Win, false);
    end;
    create a g2ui-file-dialog-settings Settings by cloning _opcsui-import-domain-map-dialog-settings;
    conclude that the default-filter of Settings = the dxiui-default-filter of DXI;
    Type = call g2-type-of-file-system ();
    DialogName = (if Type = the symbol win32 then "dxi-import-map-pc-dialog" else "dxi-import-map-dialog");
    Dlg, Button = call uil-start-dialog-processing (DialogName, Settings, Win, _opcsui-launch-dxi-import-dialog-actions, false, false, the symbol none, false);
    if Button exists and Button is an item and not (the uil-cancel-button of Button) and Dlg exists and Dlg is an item then begin
        Filename = call uil-get-edit-box-value (Dlg, "filename-edit-box");
        Directory = call uil-get-edit-box-value (Dlg, "directory-edit-box");
        call uil-release-dialog (Dlg, Win, false);
        conclude that the dxiui-directory of DXI = Directory;
        conclude that the dxi-input-file-name of DXI = "[Directory][Filename]";
        start _opcsui-post-dxi-status (this procedure-invocation, DXI, Win);
        call csuisup-process-dxi-object (DXI);
        start uil-post-generic-dialog ("[the dxi-status of DXI]", the symbol message, the symbol medium, Win, the symbol uil-information-icon);
    end;
    delete Settings;
    make DXI transient;
end

_csuisup-create-dxi-object(Client: class ui-client-item) = (class dxiui-file-input-object, truth-value)
CreationFailedError: class error;
DXI: class dxi-file-import-object;
TopModule, TranslationWkspName, DestinationWkspName, DefaultClassName, AddResult: symbol;
begin
    if there exists a dxi-file-import-object DXI that is _dxiui-object-for-window Client then return DXI, false 
    else begin
        create a dxiui-file-input-object DXI;
        conclude that DXI is now _dxiui-object-for-window Client;
        TopModule = call _devui-get-top-level-module ();
        TranslationWkspName = symbol ("[TopModule]-translation-objects");
        if there exists an item I named by TranslationWkspName and (I is a kb-workspace or the subworkspace of I exists) then conclude that the dxi-input-translation-workspace of DXI = TranslationWkspName;
        DefaultClassName = symbol ("[TopModule]-containment-object");
        if there exists a definition named by DefaultClassName then conclude that the dxi-default-class-to-create of DXI = DefaultClassName;
        DestinationWkspName = symbol ("[TopModule]-domain-map");
        if there exists an item I named by DestinationWkspName and (I is a kb-workspace or the subworkspace of I exists) then conclude that the dxi-input-destination-workspace of DXI = DestinationWkspName;
        AddResult = call _devui-add-item-to-storage-bin (DXI, TopModule, "", Client);
        make DXI transient; 
        if AddResult /= the symbol OK then begin
            delete DXI;
            signal CreationFailedError;
        end;
        return DXI, true;
    end 
end

_opcsui-create-translation-object (Module : symbol, Win: class ui-client-item) = (item-or-value) 
Item : item-or-value;
Wksp : class kb-workspace;
Result : symbol; 
begin
    create a dxi-type-to-class-object Item; 
    if Module = the symbol All then Module = call _devui-get-top-level-module ();
    Result = call _devui-add-item-to-storage-bin (Item, Module, "", Win);
    if Result = the symbol OK then begin 
        Item = call _devui-create-item(Item, Win);
        return Item;
    end
    else return the symbol UNABLE-TO-CREATE; 
end

_opcsui-create-OPAC-procedure (ChildType: symbol, Module : symbol, Win: class ui-client-item) = (item-or-value) 
Item : item-or-value;
Result: symbol;
Wksp : class kb-workspace;
Btn : class uil-hide-button;
Block : class item;
Class : symbol = the symbol opac-subtask-completion;
OrigName: text;
begin
    create an instance Item of the class named by ChildType;
    create a kb-workspace Wksp;
    make Wksp the subworkspace of Item;
    change the background-color of Wksp to extra-light-gray;
    create a uil-hide-button Btn;
    transfer Btn to Wksp at (0, 0);
    create a opac-subtask-start Block;
    transfer Block to Wksp at (5, -50);
    create an instance Block of the class named by Class;
    transfer Block to Wksp at (5, -200);
    change the size of Wksp to minimum;
    if Module = the symbol All then Module = call _devui-get-top-level-module (); 
    Result = call _devui-add-item-to-storage-bin (Item, Module, "", Win);
    if Result = the symbol OK then begin
        Item = call _devui-create-item(Item, Win);
        if Item exists and Item is an item then begin
            OrigName = the text of the names of Item;
            change the text of the names of Item to "[module]-[OrigName]-";
            return Item;
        end
        else return the symbol UNABLE-TO-CREATE;
    end
    else return the symbol UNABLE-TO-CREATE; 
end

