_opcsui-create-palette (Module : symbol, Win: class ui-client-item) = (item-or-value) 
Item : item-or-value;
Palette: class opcsrui-palette;
DummyItem : class item;
Wksp : class kb-workspace;
Result : symbol; 
begin
    create a  opcsrui-palette Palette;
    {create a kb-workspace Wksp by cloning the subworkspace of _devui-template-palette;}
    Wksp = call uil-clone-grobj-method (the subworkspace of _devui-template-palette);
    if there exists an _devui-object DummyItem upon Wksp then begin
        make DummyItem transient;
        delete DummyItem;
    end;
    make Wksp the subworkspace of Palette;
    if Module = the symbol All then Module = call _devui-get-top-level-module ();
    Result = call _devui-add-item-to-storage-bin (Palette, Module, "", Win);
    if Result = the symbol OK then begin 
        call gfr-check-uuids-on-cloned-item (Palette); {Although item was not cloned, this is a safe way to deal with the workspace hierarchy and make sure that the Palette's uuid is updated} 
        Item = call _devui-create-item(Palette, Win);
        return Item;
    end
    else return the symbol UNABLE-TO-CREATE; 
end

