_opcsui-create-browser (Module : symbol, Win: class ui-client-item) = (item-or-value) 
Browser: class sc-browser-template;
Item : item-or-value;
Result : symbol; 
begin
    {Item = call uil-clone-grobj-method (_scrollui-template-browser);  the browser is not a ui item, using simpler clone}
    create an sc-browser-template Browser by cloning _scrollui-template-browser;
    call gfr-check-uuids-on-cloned-item (Browser);

    {this is a quick fix for the bug found in GFR.  The above procedure will tack on additional tools for the browser.  This is not wanted.
    conclude that the array-length of the gxl-spreadsheet-tools of the gqsv-root-specification upon the subworkspace of Item = 0;
    Testing during Feb 99 does not indicate a problem here}

    if Module = the symbol All then Module = call _devui-get-top-level-module ();
    Result = call _devui-add-item-to-storage-bin (Browser, Module, "", Win);
    if Result = the symbol OK then begin
        Item = call _devui-create-item(Browser, Win);
        return Item;
    end
    else return the symbol UNABLE-TO-CREATE; 
end

_opcsui-create-message-server (Module : symbol, Win: class ui-client-item) = (item-or-value) 
Item : item-or-value;
Wksp : class kb-workspace;
Result : symbol;
UUID : text;
begin
    create a smh-message-server Item;
    UUID = call gfr-universal-unique-id ();
    conclude that the gfr-uuid of Item = UUID;
    create a kb-workspace Wksp by cloning the subworkspace of _smh-template-server-wksp;
    make Wksp the subworkspace of Item;       
    if Module = the symbol All then Module = call _devui-get-top-level-module ();
    Result = call _devui-add-item-to-storage-bin (Item, Module, "", Win);
    if Result = the symbol OK then begin
        Item = call _devui-create-item(Item, Win);
        return Item;
    end
    else return the symbol UNABLE-TO-CREATE;
end

_opcsui-create-class-definition (Module: symbol, DefName: symbol, Win: class ui-client-item) = (item-or-value)
Item: item-or-value;
ClassDefinition, Parent: class class-definition;
begin
    if there exists a class-definition Parent named by DefName then begin
        if Parent is an object-definition then create an object-definition ClassDefinition
        else if Parent is a message-definition then create a message-definition ClassDefinition
        else if Parent is a connection-definition then create a connection-definition ClassDefinition
        else return the symbol UNABLE-TO-CREATE;
        conclude that the direct-superior-classes of ClassDefinition = sequence (DefName);
        if Module = the symbol ALL then Module = gfr-get-module-of-item (Parent);
        call _devui-add-item-to-storage-bin (ClassDefinition, Module, "", Win);
        Item = call _devui-create-item (ClassDefinition, Win);
        return Item;
    end
    else return the symbol UNABLE-TO-CREATE;
end
